    private readonly IMediator _mediator;

    public GetVehicles(IMediator mediator)
    {
        _mediator = mediator;
    }

    [Authorize]
    [SwaggerOperation(Tags = new[] { "Vehicles" }, Summary = "Get active vehicles according to parameters")]
    [HttpGet("/api/vehicles/")]
    public async Task<IActionResult> GetVehiclesAsync(int? offset, int? limit, string location, int userAge, SexType userSexType, int? ageFrom, int? ageTo, SexType? sexTypes)
    {
        var pagination = new PaginationArgs
        {
            Page = offset ?? 0,
            PageSize = limit ?? 10
        };
        return await _mediator.Send(new GetVehiclesQuery(pagination, location, userAge, userSexType, ageFrom, ageTo, sexTypes)).Process();
    }

