        public GetVehiclesQuery(PaginationArgs paginationArgs, string location, int userAge, SexType userSexType, int? ageFrom, int? ageTo, SexType? sexTypes)
        {
            PaginationArgs = paginationArgs;
            Location = location;
            UserAge = userAge;
            UserSexType = userSexType;
            AgeFrom = ageFrom;
            AgeTo = ageTo;
            SexTypes = sexTypes;
        }
        public PaginationArgs PaginationArgs { get; set; }
        public string Location { get; set; }
        public int UserAge { get; set; }
        public SexType UserSexType { get; set; }
        public int? AgeFrom { get; set; }
        public int? AgeTo { get; set; }
        public SexType? SexTypes { get; set; }
    }

